import React, { Component } from 'react';
import logo from '../logo.jpeg';

class Header extends Component {
    render() {
        return (
            <div>
                <h1><a href=""><img src={logo} alt="FESTIVAL DE CANNES" /></a></h1>
                <ul>
                    <li>
                        <a href="">ALL</a>
                    </li>
                </ul>
            </div>
        );
    }
}

export default Header;
